import React from 'react';

const RealisticPizzaBurger = () => {
  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Realistic Pizza & Burger</h2>
      
      <div style={styles.itemsContainer}>
        <div style={styles.item}>
          <h3 style={styles.itemTitle}>Delicious Pizza</h3>
          <img
            src="https://example.com/realistic-pizza.jpg" // Replace with a real pizza image URL
            alt="Realistic Pizza"
            style={styles.image}
          />
        </div>

        <div style={styles.item}>
          <h3 style={styles.itemTitle}>Tasty Burger</h3>
          <img
            src="https://example.com/realistic-burger.jpg" // Replace with a real burger image URL
            alt="Realistic Burger"
            style={styles.image}
          />
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    textAlign: "center",
    padding: "20px",
    background: "linear-gradient(135deg, #f7d9e3, #fcc2e4)",
    borderRadius: "10px",
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.2)",
    maxWidth: "800px",
    margin: "auto",
  },
  heading: {
    color: "#ff77aa",
    fontFamily: "'Poppins', sans-serif",
    marginBottom: "20px",
  },
  itemsContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "30px",
    flexWrap: "wrap",
  },
  item: {
    textAlign: "center",
    flex: "1 1 45%",
  },
  itemTitle: {
    fontSize: "1.5rem",
    color: "#ff6347",
    fontWeight: "bold",
    marginBottom: "15px",
  },
  image: {
    width: "100%",
    height: "auto",
    borderRadius: "8px",
    border: "3px solid #ff69b4",
  },
};

export default RealisticPizzaBurger;
